webpackJsonp([0xd4f2c1887bbe],{403:function(e,n){e.exports={data:{markdownRemark:{html:'<h1>NOTE: This "post" is based on <a href="https://github.com/adam-p/markdown-here/wiki/Markdown-Cheatsheet">Markdown Cheatsheet</a> and is meant to test styling of Markdown generated documents.</h1>\n<p>This is intended as a quick reference and showcase. For more complete info, see <a href="http://daringfireball.net/projects/markdown/">John Gruber\'s original spec</a> and the <a href="http://github.github.com/github-flavored-markdown/">Github-flavored Markdown info page</a>.</p>\n<p>This cheatsheet is specifically <em>Markdown Here\'s</em> version of Github-flavored Markdown. This differs slightly in styling and syntax from what Github uses, so what you see below might vary a little from what you get in a <em>Markdown Here</em> email, but it should be pretty close.</p>\n<p>You can play around with Markdown on our <a href="http://www.markdown-here.com/livedemo.html">live demo page</a>.</p>\n<p>(If you\'re not a Markdown Here user, check out the <a href="./Markdown-Cheatsheet">Markdown Cheatsheet</a> that is not specific to MDH. But, really, you should also use Markdown Here, because it\'s awesome. <a href="http://markdown-here.com">http://markdown-here.com</a>)</p>\n<h5>Table of Contents</h5>\n<p><a href="#headers">Headers</a>\n<a href="#emphasis">Emphasis</a>\n<a href="#lists">Lists</a>\n<a href="#links">Links</a>\n<a href="#images">Images</a>\n<a href="#code">Code and Syntax Highlighting</a>\n<a href="#tables">Tables</a>\n<a href="#blockquotes">Blockquotes</a>\n<a href="#html">Inline HTML</a>\n<a href="#hr">Horizontal Rule</a>\n<a href="#lines">Line Breaks</a>\n<a href="#videos">YouTube Videos</a></p>\n<a name="headers"/>\n<h2>Headers</h2>\n<div class="gatsby-highlight">\n      <pre class="language-no-highlight"><code># H1\n## H2\n### H3\n#### H4\n##### H5\n###### H6\n\nAlternatively, for H1 and H2, an underline-ish style:\n\nAlt-H1\n======\n\nAlt-H2\n------</code></pre>\n      </div>\n<h1>H1</h1>\n<h2>H2</h2>\n<h3>H3</h3>\n<h4>H4</h4>\n<h5>H5</h5>\n<h6>H6</h6>\n<p>Alternatively, for H1 and H2, an underline-ish style:</p>\n<h1>Alt-H1</h1>\n<h2>Alt-H2</h2>\n<a name="emphasis"/>\n<h2>Emphasis</h2>\n<div class="gatsby-highlight">\n      <pre class="language-no-highlight"><code>Emphasis, aka italics, with *asterisks* or _underscores_.\n\nStrong emphasis, aka bold, with **asterisks** or __underscores__.\n\nCombined emphasis with **asterisks and _underscores_**.\n\nStrikethrough uses two tildes. ~~Scratch this.~~</code></pre>\n      </div>\n<p>Emphasis, aka italics, with <em>asterisks</em> or <em>underscores</em>.</p>\n<p>Strong emphasis, aka bold, with <strong>asterisks</strong> or <strong>underscores</strong>.</p>\n<p>Combined emphasis with <strong>asterisks and <em>underscores</em></strong>.</p>\n<p>Strikethrough uses two tildes. <del>Scratch this.</del></p>\n<a name="lists"/>\n<h2>Lists</h2>\n<div class="gatsby-highlight">\n      <pre class="language-no-highlight"><code>1. First ordered list item\n2. Another item\n  * Unordered sub-list.\n1. Actual numbers don\'t matter, just that it\'s a number\n  1. Ordered sub-list\n4. And another item.\n\n   Some text that should be aligned with the above item.\n\n* Unordered list can use asterisks\n- Or minuses\n+ Or pluses</code></pre>\n      </div>\n<ol>\n<li>\n<p>First ordered list item</p>\n</li>\n<li>\n<p>Another item</p>\n<ul>\n<li>Unordered sub-list.</li>\n</ul>\n</li>\n<li>\n<p>Actual numbers don\'t matter, just that it\'s a number</p>\n<ol>\n<li>Ordered sub-list</li>\n</ol>\n</li>\n<li>\n<p>And another item.</p>\n<p>Some text that should be aligned with the above item.</p>\n</li>\n<li>\n<p>Unordered list can use asterisks</p>\n</li>\n<li>\n<p>Or minuses</p>\n</li>\n<li>\n<p>Or pluses</p>\n</li>\n</ol>\n<a name="links"/>\n<h2>Links</h2>\n<p>There are two ways to create links.</p>\n<div class="gatsby-highlight">\n      <pre class="language-no-highlight"><code>[I\'m an inline-style link](https://www.google.com)\n\n[I\'m a reference-style link][Arbitrary case-insensitive reference text]\n\n[You can use numbers for reference-style link definitions][1]\n\nOr leave it empty and use the [link text itself]\n\nURLs and URLs in angle brackets will automatically get turned into links.\nhttp://www.example.com or <http://www.example.com> and sometimes\nexample.com (but not on Github, for example).\n\nSome text to show that the reference links can follow later.\n\n[arbitrary case-insensitive reference text]: https://www.mozilla.org\n[1]: http://slashdot.org\n[link text itself]: http://www.reddit.com</code></pre>\n      </div>\n<p><a href="https://www.google.com">I\'m an inline-style link</a></p>\n<p><a href="https://www.mozilla.org">I\'m a reference-style link</a></p>\n<p><a href="http://slashdot.org">You can use numbers for reference-style link definitions</a></p>\n<p>Or leave it empty and use the <a href="http://www.reddit.com">link text itself</a></p>\n<p>URLs and URLs in angle brackets will automatically get turned into links.\n<a href="http://www.example.com">http://www.example.com</a> or <a href="http://www.example.com">http://www.example.com</a> and sometimes\nexample.com (but not on Github, for example).</p>\n<p>Some text to show that the reference links can follow later.</p>\n<a name="images"/>\n<h2>Images</h2>\n<div class="gatsby-highlight">\n      <pre class="language-no-highlight"><code>Here\'s our logo (hover to see the title text):\n\nInline-style:\n![alt text](https://github.com/adam-p/markdown-here/raw/master/src/common/images/icon48.png "Logo Title Text 1")\n\nReference-style:\n![alt text][logo]\n\n[logo]: https://github.com/adam-p/markdown-here/raw/master/src/common/images/icon48.png "Logo Title Text 2"</code></pre>\n      </div>\n<p>Here\'s our logo (hover to see the title text):</p>\n<p>Inline-style:\n<img src="https://github.com/adam-p/markdown-here/raw/master/src/common/images/icon48.png" alt="alt text" title="Logo Title Text 1"></p>\n<p>Reference-style:\n<img src="https://github.com/adam-p/markdown-here/raw/master/src/common/images/icon48.png" alt="alt text" title="Logo Title Text 2"></p>\n<a name="code"/>\n<h2>Code and Syntax Highlighting</h2>\n<p>Code blocks are part of the Markdown spec, but syntax highlighting isn\'t. However, many renderers -- like Github\'s and <em>Markdown Here</em> -- support syntax highlighting. <em>Markdown Here</em> supports highlighting for dozens of languages (and not-really-languages, like diffs and HTTP headers); to see the complete list, and how to write the language names, see the <a href="http://softwaremaniacs.org/media/soft/highlight/test.html">highlight.js demo page</a>.</p>\n<div class="gatsby-highlight">\n      <pre class="language-no-highlight"><code>Inline `code` has `back-ticks around` it.</code></pre>\n      </div>\n<p>Inline <code>code</code> has <code>back-ticks around</code> it.</p>\n<p>Blocks of code are either fenced by lines with three back-ticks <code>`<code></code></code>, or are indented with four spaces. I recommend only using the fenced code blocks -- they\'re easier and only they support syntax highlighting.</p>\n<pre lang="no-highlight"><code>```javascript\nvar s = "JavaScript syntax highlighting";\nalert(s);\n```\n\n```python\ns = "Python syntax highlighting"\nprint s\n```\n\n```\nNo language indicated, so no syntax highlighting.\nBut let\'s throw in a &lt;b&gt;tag&lt;/b&gt;.\n```\n</code></pre>\n<div class="gatsby-highlight">\n      <pre class="language-javascript"><code><span class="token keyword">var</span> s <span class="token operator">=</span> <span class="token string">"JavaScript syntax highlighting"</span><span class="token punctuation">;</span>\n<span class="token function">alert</span><span class="token punctuation">(</span>s<span class="token punctuation">)</span><span class="token punctuation">;</span>\n</code></pre>\n      </div>\n<div class="gatsby-highlight">\n      <pre class="language-python"><code>s <span class="token operator">=</span> <span class="token string">"Python syntax highlighting"</span>\n<span class="token keyword">print</span> s\n</code></pre>\n      </div>\n<div class="gatsby-highlight">\n      <pre class="language-none"><code>No language indicated, so no syntax highlighting in Markdown Here (varies on Github).\nBut let\'s throw in a <b>tag</b>.</code></pre>\n      </div>\n<p>Again, to see what languages are available for highlighting, and how to write those language names, see the <a href="http://softwaremaniacs.org/media/soft/highlight/test.html">highlight.js demo page</a>.</p>\n<a name="tables"/>\n<h2>Tables</h2>\n<p>Tables aren\'t part of the core Markdown spec, but they are part of GFM and <em>Markdown Here</em> supports them. They are an easy way of adding tables to your email -- a task that would otherwise require copy-pasting from another application.</p>\n<div class="gatsby-highlight">\n      <pre class="language-no-highlight"><code>Colons can be used to align columns.\n\n| Tables        | Are           | Cool  |\n| ------------- |:-------------:| -----:|\n| col 3 is      | right-aligned | $1600 |\n| col 2 is      | centered      |   $12 |\n| zebra stripes | are neat      |    $1 |\n\nThe outer pipes (|) are optional, and you don\'t need to make the raw Markdown line up prettily. You can also use inline Markdown.\n\nMarkdown | Less | Pretty\n--- | --- | ---\n*Still* | `renders` | **nicely**\n1 | 2 | 3</code></pre>\n      </div>\n<p>Colons can be used to align columns.</p>\n<table>\n<thead>\n<tr>\n<th>Tables</th>\n<th align="center">Are</th>\n<th align="right">Cool</th>\n</tr>\n</thead>\n<tbody>\n<tr>\n<td>col 3 is</td>\n<td align="center">right-aligned</td>\n<td align="right">$1600</td>\n</tr>\n<tr>\n<td>col 2 is</td>\n<td align="center">centered</td>\n<td align="right">$12</td>\n</tr>\n<tr>\n<td>zebra stripes</td>\n<td align="center">are neat</td>\n<td align="right">$1</td>\n</tr>\n</tbody>\n</table>\n<p>The outer pipes (|) are optional, and you don\'t need to make the raw Markdown line up prettily. You can also use inline Markdown.</p>\n<table>\n<thead>\n<tr>\n<th>Markdown</th>\n<th>Less</th>\n<th>Pretty</th>\n</tr>\n</thead>\n<tbody>\n<tr>\n<td><em>Still</em></td>\n<td><code>renders</code></td>\n<td><strong>nicely</strong></td>\n</tr>\n<tr>\n<td>1</td>\n<td>2</td>\n<td>3</td>\n</tr>\n</tbody>\n</table>\n<a name="blockquotes"/>\n<h2>Blockquotes</h2>\n<div class="gatsby-highlight">\n      <pre class="language-no-highlight"><code>> Blockquotes are very handy in email to emulate reply text.\n> This line is part of the same quote.\n\nQuote break.\n\n> This is a very long line that will still be quoted properly when it wraps. Oh boy let\'s keep writing to make sure this is long enough to actually wrap for everyone. Oh, you can *put* **Markdown** into a blockquote.</code></pre>\n      </div>\n<blockquote>\n<p>Blockquotes are very handy in email to emulate reply text.\nThis line is part of the same quote.</p>\n</blockquote>\n<p>Quote break.</p>\n<blockquote>\n<p>This is a very long line that will still be quoted properly when it wraps. Oh boy let\'s keep writing to make sure this is long enough to actually wrap for everyone. Oh, you can <em>put</em> <strong>Markdown</strong> into a blockquote.</p>\n</blockquote>\n<a name="html"/>\n<h2>Inline HTML</h2>\n<p>You can also use raw HTML in your Markdown, and it\'ll mostly work pretty well.</p>\n<div class="gatsby-highlight">\n      <pre class="language-no-highlight"><code><dl>\n  <dt>Definition list</dt>\n  <dd>Is something people use sometimes.</dd>\n\n  <dt>Markdown in HTML</dt>\n  <dd>Does *not* work **very** well. Use HTML <em>tags</em>.</dd>\n</dl></code></pre>\n      </div>\n<dl>\n  <dt>Definition list</dt>\n  <dd>Is something people use sometimes.</dd>\n  <dt>Markdown in HTML</dt>\n  <dd>Does *not* work **very** well. Use HTML <em>tags</em>.</dd>\n</dl>\n<a name="hr"/>\n<h2>Horizontal Rule</h2>\n<div class="gatsby-highlight">\n      <pre class="language-none"><code>Three or more...\n\n---\n\nHyphens\n\n***\n\nAsterisks\n\n___\n\nUnderscores</code></pre>\n      </div>\n<p>Three or more...</p>\n<hr>\n<p>Hyphens</p>\n<hr>\n<p>Asterisks</p>\n<hr>\n<p>Underscores</p>\n<a name="lines"/>\n<h2>Line Breaks</h2>\n<p>My basic recommendation for learning how line breaks work is to experiment and discover -- hit &#x3C;Enter> once (i.e., insert one newline), then hit it twice (i.e., insert two newlines), see what happens. You\'ll soon learn to get what you want. "Markdown Toggle" is your friend.</p>\n<p>Here are some things to try out:</p>\n<div class="gatsby-highlight">\n      <pre class="language-none"><code>Here\'s a line for us to start with.\n\nThis line is separated from the one above by two newlines, so it will be a *separate paragraph*.\n\nThis line is also a separate paragraph, but...\nThis line is only separated by a single newline, so it\'s a separate line in the *same paragraph*.</code></pre>\n      </div>\n<p>Here\'s a line for us to start with.</p>\n<p>This line is separated from the one above by two newlines, so it will be a <em>separate paragraph</em>.</p>\n<p>This line is also begins a separate paragraph, but...\nThis line is only separated by a single newline, so it\'s a separate line in the <em>same paragraph</em>.</p>\n<p>(Technical note: <em>Markdown Here</em> uses GFM line breaks, so there\'s no need to use MD\'s two-space line breaks.)</p>\n<a name="videos"/>\n<h2>YouTube Videos</h2>\n<p>They can\'t be added directly but you can add an image with a link to the video like this:</p>\n<div class="gatsby-highlight">\n      <pre class="language-no-highlight"><code><a href="http://www.youtube.com/watch?feature=player_embedded&v=8AkLfYOgIrE\n" target="_blank"><img src="http://img.youtube.com/vi/8AkLfYOgIrE/0.jpg"\nalt="IMAGE ALT TEXT HERE" width="240" height="180" border="10" /></a></code></pre>\n      </div>\n<p>Or, in pure Markdown, but losing the image sizing and border:</p>\n<div class="gatsby-highlight">\n      <pre class="language-no-highlight"><code>[![IMAGE ALT TEXT HERE](http://img.youtube.com/vi/YOUTUBE_VIDEO_ID_HERE/0.jpg)](http://www.youtube.com/watch?v=YOUTUBE_VIDEO_ID_HERE)</code></pre>\n      </div>',timeToRead:8,excerpt:'NOTE: This "post" is based on  Markdown Cheatsheet  and is meant to test styling of Markdown generated documents. This is intended as a…',frontmatter:{title:"Big Test",cover:"https://unsplash.it/400/300/?random?BigTest",date:"01/03/2018",category:"blog",startTime:null,tags:["test","huge"],thumbnail:{childImageSharp:{responsiveSizes:{src:"/static/Griegcomp-52e5bd6996d69152ef41de4a5fa1a0de-431fe.jpg",srcSet:"/static/Griegcomp-52e5bd6996d69152ef41de4a5fa1a0de-23ca2.jpg 480w,\n/static/Griegcomp-52e5bd6996d69152ef41de4a5fa1a0de-17a62.jpg 960w,\n/static/Griegcomp-52e5bd6996d69152ef41de4a5fa1a0de-431fe.jpg 1920w,\n/static/Griegcomp-52e5bd6996d69152ef41de4a5fa1a0de-7f9bb.jpg 2880w,\n/static/Griegcomp-52e5bd6996d69152ef41de4a5fa1a0de-5837d.jpg 3840w,\n/static/Griegcomp-52e5bd6996d69152ef41de4a5fa1a0de-6804c.jpg 5044w",sizes:"(max-width: 1920px) 100vw, 1920px",base64:"data:image/jpeg;base64,"}}}},fields:{slug:"/big-test"}}},pathContext:{slug:"/big-test"}}}});
